export default function RecordTile(props){

    const date = new Date(props.date).toLocaleDateString()

    const one=()=>{
        return(
            <p>
        {date} | length:{props.length} | {props.language} | correction: {props.hasCorrection} | comment: {props.hasComment}
        </p>
        )
    }
    const more = ()=>{
        return(
            <p>
            {date} | number:{props.number} | comment: {props.hasComment}
            </p>
        )
    }
    return(
        <div className="record-tile">

            {props.number==1?one():more()}

        </div>)
}
